import React from "react";
import "./App.css";
import OurService from "./component/OurService-component/OurService";
import OurProject from "./component/OurProject/OurProject";
import DesignProcess from "./component/DesignProces-component/DesignProcess";
import Work from "./component/work-component/Work";
import Form from "./component/form/Form";

function App() {
  return (
    <div>
      <section className="sec1">
        <OurService />
      </section>
      <section className="sec2">
        <OurProject />
      </section>
      <section className="sec3">
        <DesignProcess />
      </section>
      <section className="sec4">
        <Work />
      </section>
      <section className="sec4">
        <Form />
      </section>
    </div>
  );
}

export default App;
